import React from 'react';

function RoomsList({ rooms }) {
  if (!rooms.length) {
    return (
      <div className='empty-search'>
        <h3>unfortunately no rooms matched your search parameters</h3>
      </div>
    );
  }

  return <section className='roomslist'></section>;
}

export default RoomsList;
